La Anglikana Komunio estas la amplekso de la kristanaj eklezioj kiuj havas strukturon, organizon kaj praktikon devenantan de la anglikanismo kaj estas en komunumeco inter si. Inter ili la plej, historie kaj pro nombro de fideluloj, grava estas la Eklezio de Anglio. Laŭ iuj la anglkanaj eklezioj ne tute ĝuste apartenas al la difino de protestantaj, ĉar la termino “protestanto” ofte estas sinonimo de luterano aŭ kalvinisto aŭ “evangeliano”. Tamen, ili havis originon kaj kvazaŭ laŭleĝecon el la evento “potestantismo” ankaŭ se ilia kredo similas pli al tiu katolika ol al tiu protestanta. Aparte la anglikanaj eklezioj povus esti ideale dividitaj laŭ du fluoj: 
* tiu "alta", doktrine proksima al la pozicioj de la Katolika Eklezio; 
* tiu "malalta", pli influita de la pozicioj de Protestantismo. Ambaŭ tamen konservas fortajn ligilojn kun la Anglikana Komunio aŭ kun la “Anglikana Tradicio”: temas pri la plej granda fluo en Anglio, en Kimrio kaj en iuj landoj de Commonwealth, sed malpli sekvata en Usono kaj en la cetera mondo.
